import React, { useState, useEffect } from "react";

function Movies() {
  const [movies, setMovies] = useState(null);
  useEffect(() => {
    fetch("https://imdb-top-100-movies.p.rapidapi.com/top32", {
      method: "GET",
      headers: {
        'X-RapidAPI-Key': '189773483emshdf5c2b3eaeea748p1e6fe0jsnaf1dd42e45d5',
		'X-RapidAPI-Host': 'imdb-top-100-movies.p.rapidapi.com'
      },
    })
      .then((response) => response.json())
      .then((data) => {
        setMovies(data);
        console.log(data);
      })
      .catch((error) => console.log(error));
  }, []);
  return (
    <div>
      {movies.map(movie => (
        <h1>{movie.title}</h1>
      ))}
    </div>
  );
}
export default Movies;
